PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "online_tbl_category_add" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NULL, "status" varchar(100) NULL, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "online_tbl_contact" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Name" varchar(50) NULL, "phone_no" integer NULL, "email" varchar(100) NULL, "message" varchar(300) NULL);
CREATE TABLE IF NOT EXISTS "online_tbl_register" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NULL, "email" varchar(254) NULL, "mobile" integer NULL, "password" varchar(100) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "online_tbl_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "product_id" varchar(100) NOT NULL, "image" varchar(100) NULL, "description" text NULL, "stock" integer NULL, "original_price" real NULL, "offer_price" real NULL, "fabric" varchar(100) NULL, "Pattern" varchar(100) NULL, "WashCare" varchar(100) NULL, "size" varchar(50) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "category_id" bigint NULL REFERENCES "online_tbl_category_add" ("id") DEFERRABLE INITIALLY DEFERRED, "color" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "online_orderitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "price" decimal NOT NULL, "order_id" bigint NOT NULL REFERENCES "online_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "online_tbl_product" ("id") DEFERRABLE INITIALLY DEFERRED, "color" varchar(20) NULL, "image" varchar(100) NULL, "size" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "online_tbl_productvariant" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "color" varchar(50) NULL, "image" varchar(100) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "product_id" bigint NOT NULL REFERENCES "online_tbl_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "online_tbl_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "session_key" varchar(50) NULL, "quantity" integer NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "product_id" bigint NOT NULL REFERENCES "online_tbl_product" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "online_tbl_register" ("id") DEFERRABLE INITIALLY DEFERRED, "color" varchar(20) NULL, "size" varchar(20) NULL, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "online_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "full_name" varchar(255) NOT NULL, "address" text NOT NULL, "city" varchar(100) NOT NULL, "postal_code" varchar(20) NOT NULL, "phone" varchar(15) NOT NULL, "total_price" decimal NOT NULL, "created_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "online_tbl_register" ("id") DEFERRABLE INITIALLY DEFERRED, "status" varchar(100) NULL, "d_date" datetime NULL, "p_date" datetime NULL);
CREATE TABLE IF NOT EXISTS "online_customdressorder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "dress_name" varchar(255) NOT NULL, "fabric" varchar(100) NOT NULL, "color" varchar(50) NOT NULL, "size" varchar(50) NOT NULL, "neck_design" varchar(100) NOT NULL, "custom_neck_design" varchar(255) NULL, "bust" real NOT NULL, "waist" real NOT NULL, "hips" real NOT NULL, "length" real NOT NULL, "delivery_date" date NOT NULL, "reference_image" varchar(100) NULL, "additional_details" text NULL, "created_at" datetime NOT NULL, "user_id" bigint NULL REFERENCES "online_tbl_register" ("id") DEFERRABLE INITIALLY DEFERRED, "status" varchar(100) NULL, "advance" real NULL, "payment_status" varchar(100) NULL, "total_cost" real NULL, "work_status" varchar(100) NULL);
CREATE UNIQUE INDEX "auth_group_permissions_group_id_permission_id_0cd325b0_uniq" ON "auth_group_permissions" ("group_id", "permission_id");
